INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("植田佳奈", "クルミ（クリスマス）", 0, 9, "ヒューマン", "観劇、おままごと", 40, "サレンディア救護院", 150, 6, "B", 108501, "泣き虫で臆病な守ってあげたい女の子", 9, 12, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！");
